import React, { useState, useEffect } from "react";
import products from "../Data/data.js";
import '../Styles/searchPage.css' // Ensure your custom styles work alongside Tailwind

// BTree class to store products by ID
class BTree {
  constructor() {
    this.products = new Map();
  }

  insert(key, product) {
    this.products.set(key, product);
  }

  search(key) {
    return this.products.get(key);
  }
}

// InvertedIndex class to map keywords to product IDs
class InvertedIndex {
  constructor() {
    this.index = new Map();
  }

  add(term, productId) {
    if (!this.index.has(term)) {
      this.index.set(term, new Set());
    }
    this.index.get(term).add(productId);
  }

  search(term) {
    return this.index.get(term) || new Set();
  }
}

// HybridIndex class that combines BTree and InvertedIndex
class HybridIndex {
  constructor() {
    this.bTree = new BTree();
    this.invertedIndex = new InvertedIndex();
  }

  addProduct(product) {
    // Add product to B-Tree by ID
    this.bTree.insert(product.id, product);

    // Add product to Inverted Index using keywords
    product.keywords.forEach((keyword) => {
      this.invertedIndex.add(keyword.toLowerCase(), product.id);
    });
  }

  search(query) {
    const keywords = query.toLowerCase().split(" ").filter(Boolean);
    const resultIds = new Set();

    keywords.forEach((keyword) => {
      const ids = this.invertedIndex.search(keyword);
      ids.forEach((id) => resultIds.add(id));
    });

    return Array.from(resultIds).map((id) => this.bTree.search(id));
  }
}

// Initialize HybridIndex once outside the component
const hybridIndex = new HybridIndex();
products.forEach((product) => hybridIndex.addProduct(product));

const ProductSearch = () => {
  const [query, setQuery] = useState("");
  const [results, setResults] = useState([]);

  // Handle search input and results
  const searchProduct = (event) => {
    const inputValue = event.target.value;
    setQuery(inputValue);
    const searchResults = hybridIndex.search(inputValue);
    setResults(searchResults);
  };

  const handleClear = () => {
    setQuery("");
    setResults([]);
  };

  const handleSubmit = (event) => {
    event.preventDefault(); // Prevent page reload
    const searchResults = hybridIndex.search(query);
    setResults(searchResults);
  };

  return (
    <div className="bg-slate-700 h-screen px-10 py-20 w-full">
      <form onSubmit={handleSubmit}>
        <div className="max-w-xl">
          <div className="flex space-x-1 items-center mb-2">
            <svg
              xmlns="http://www.w3.org/2000/svg"
              className="h-8 w-8 text-red-500"
              fill="none"
              viewBox="0 0 24 24"
              stroke="currentColor"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth="2"
                d="M13 16h-1v-4h-1m1-4h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z"
              />
            </svg>
            <p className="text-white text-lg font-semibold">
              Please enter something
            </p>
          </div>
          <div className="flex space-x-4">
            <div className="flex rounded-md overflow-hidden w-full">
              <input
                type="text"
                className="w-full rounded-md rounded-r-none"
                value={query}
                onChange={searchProduct}
                placeholder="Search for a product..."
              />
            </div>
            <button
              type="submit"
              className="bg-indigo-600 text-white px-6 text-lg font-semibold py-4 rounded-r-md"
            >
              Go
            </button>
            <button
              type="button"
              className="bg-white px-6 text-lg font-semibold py-4 rounded-md"
              onClick={handleClear}
            >
              Clear
            </button>
          </div>
        </div>
      </form>

      <div className="mt-5">
        {results.length > 0 ? (
          results.map((product) => (
            <div key={product.id} className="text-white">
              {product.name}
            </div>
          ))
        ) : (
          <div className="text-white">No products found</div>
        )}
      </div>
    </div>
  );
};

export default ProductSearch;
